import React, { Component } from "react";
import Node from "./node";

class Pathing extends Component {
  constructor(props) {
    super(props);
    this.state = { grid: [] };
  }

  componentDidMount() {
    const grid = [];
    for (let row = 0; row < 10; row++) {
      const currentrow = [];
      for (let col = 0; col < 10; col++) {
        currentrow.push([]);
      }
      grid.push(currentrow);
    }
    this.setState({ grid });
  }

  render() {
    const { grid } = this.state;
	console.log(grid);

    return (
      <div>
        <button>Start</button>
        <div className="grid">
          <div className="nodes">
            {grid.map((row, rowindex) => {
              return
              <div>
                {row.map((node, nodeindex) => (<Node />
                ))}
              </div>
            })}
          </div>
        </div>
      </div>
    );
  }
}

export default Pathing;
